const FindPivotIndex = (arr, low, high) =>{

    let pivot = arr[low]
    let i = low;
    let j = high
    let temp;


    while( i < j ){

        while(arr[i] <= pivot && i <= high -1 ){
            i++
        }

        while(arr[j] > pivot && j >= low +1 ){
            j--
        }

        if(i < j){
            // swap(arr[i], arr[j])
            temp = arr[i]
            arr[i] =arr[j]
            arr[j]=temp
        }
    }

    // swap(arr[j], pivot)
    temp = arr[j]
    arr[j] =arr[low]
    arr[low]=temp

    return j

}




const QuickSort = (arr, low, high, fn) =>{
    if (low < high) {
    const pivotIndex = FindPivotIndex(arr, low, high, fn)
    QuickSort(arr, low, pivotIndex-1, fn)
    QuickSort(arr, pivotIndex+1, high, fn)
    
    }
    return arr
}

const fn =(n) =>{

    return n.x
}

var sortBy = function(arr, fn) {

    QuickSort(arr, 0, arr.length-1, fn)
     
 };


